import React from 'react';

import productImage from './images/pizzas/bav.jpg';

const PizzaProducts = function () {

    const PizzaProducts = require('./json/pizzas.json');

    return (
        <li className="product">
            <div className="product-img"><img src={PizzaProducts.product.img}></img></div>
            <div className="product-description">
                <h3>{PizzaProducts.product.name}</h3>
                <div className="size-weight">{PizzaProducts.product.size}</div>
                <div className="description">{PizzaProducts.product.description}</div>
            </div>
            <div className="add-container">
                <div className="cost">{PizzaProducts.product.cost}</div>
                <button className="add-btn">В корзину</button>
            </div>
        </li>
    );
};

export default PizzaProducts;
